import React, {useState,useEffect} from "react";
import Shifter from "./Shifter";
import "./Items.css";
import ShifterText from "./ShifterText";

const Items = (props) => {

  const [whoWork, setWhoWork] = useState(props.data)
  const updateDataHandler = (newQ) => {
    setWhoWork(newQ);
  }
  useEffect(() => console.log('rendered'),[whoWork])
  if (props.data.length === 0) {
    return;
  }

  return (
    <div className="item___main">
      <ul className="item___half">
        <Shifter data={whoWork} updateData={updateDataHandler}/>;
      </ul>
      <ul className="item___half myTextItem">
        <ShifterText data={whoWork} />;
      </ul>
    </div>
  );
};

export default Items;
